import React from "react";
import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
import { faYoutubeSquare, faQuora, faFreeCodeCamp, faFirefox, faGithubSquare, faMedium, faDev, faStackOverflow } from "@fortawesome/free-brands-svg-icons";
import { faGlobe } from "@fortawesome/free-solid-svg-icons";

const icons = {
    "youtube" : () =>  {return (<FontAwesomeIcon icon={faYoutubeSquare} size="lg" />)},
    "quora" : () =>  {return (<FontAwesomeIcon icon={faQuora} size="lg" />)},
    "stack-overflow" : () =>  {return (<FontAwesomeIcon icon={faStackOverflow} size="lg" />)},
    "free-code-camp" : () =>  (<FontAwesomeIcon icon={faFreeCodeCamp} size="lg" />),
    "globe" : () =>  (<FontAwesomeIcon icon={faGlobe} size="lg" />),
    "firefox" : () =>  (<FontAwesomeIcon icon={faFirefox} size="lg" />),
    "github" : () =>  (<FontAwesomeIcon icon={faGithubSquare} size="lg" />),
    "medium" : () =>  (<FontAwesomeIcon icon={faMedium} size="lg" />),
    "dev" : () =>  (<FontAwesomeIcon icon={faDev} size="lg" />),
}

export default {
    getIcon : (site) => {
        return ("youtube" === site && <FontAwesomeIcon icon={faYoutubeSquare} size="lg" />)
        return ("quora" === site && <FontAwesomeIcon icon={faYoutubeSquare} size="lg" />)
        return ("stack-overflow" === site && <FontAwesomeIcon icon={faYoutubeSquare} size="lg" />)
        return ("free-code-camp" === site && <FontAwesomeIcon icon={faYoutubeSquare} size="lg" />)
        return ("globe" === site && <FontAwesomeIcon icon={faYoutubeSquare} size="lg" />)
        return ("firefox" === site && <FontAwesomeIcon icon={faYoutubeSquare} size="lg" />)
        return ("github" === site && <FontAwesomeIcon icon={faYoutubeSquare} size="lg" />)
        return ("medium" === site && <FontAwesomeIcon icon={faYoutubeSquare} size="lg" />)
    }
}
